        public static string Generate(int minlenght = 20)
        {
            Random rnd = new Random();
            string[] words = ipsum.Split(new char[] { ' ', '.', ',', '\r', '\n' }, 10000, StringSplitOptions.RemoveEmptyEntries);
            string str = "";
            int num = rnd.Next(0, 9);

            while (str.Length < minlenght)
            {
                string wrd = words[rnd.Next(0, words.Length - 1)] + num;
                wrd = wrd.Substring(0, 1).ToUpper() + wrd.Substring(1).ToLower();
                str += wrd;
            }

            return str.Substring(0, str.Length - 1);
        }

